import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import { isAuthenticated } from "../auth";
import { getUserOrders } from "../user";

const Orders = () => {
  const { userId } = useParams();

  const [orders, setOrders] = useState();

  const { user, token } = isAuthenticated();

  const getUserOrderDetails = async (userId, token) => {
    try {
      const data = await getUserOrders(userId, token);
      if (data.error) {
        return console.log(data.error);
      } else {
        // console.log(data);
        setOrders(data);
      }
    } catch (error) {}
  };

  useEffect(() => {
    getUserOrderDetails(userId, token);
  }, []);
  return (
    <section className="userBoard-right-section accounts-section">
      <h1 className="userBoard-right-header">Orders</h1>
      <div className="userBoard-right-subSec">
        <div className="userBoard-right-subHead">
          <div className="userBoard-header">Orders Information</div>
          <img src="" alt="" className="userBoard-icon" />
        </div>
        <table>
          <tr>
            <thead>
              <th>Products</th>
              <th>Order ID</th>
              <th>Status</th>
              <th>Total</th>
              <th>Payment Mode</th>
              <th>Delivery Boy</th>
              <th>Action</th>
            </thead>
          </tr>
        </table>
        <div className="userBoard-right-subDetail">
          {orders &&
            orders.map((order, index) => {
              return (
                <tr key={index}>
                  <tbody>
                    <td>{order.Oproducts}</td>
                    <td>{order._id}</td>
                    <td>{order.Ostatus}</td>
                    <td>{order.Ototal}</td>
                    <td>{order.OpaymentMode}</td>
                    <td>{order.employeeId}</td>
                    <td>
                      <button>Preview</button>
                    </td>
                  </tbody>
                </tr>
              );
            })}
        </div>
      </div>
    </section>
  );
};

export default Orders;
